B.Cu=new A.X("Single system image","Setup improvements","Starting with version 2022.44.1 there is a new way to install Tesla Android.\n\nNew single image setup process that does not need adb or fastboot. This change requires a 64GB(or larger) SD card.")
B.Cn=new A.X("LTE","Fixes for Huawei E3372","Previous release broke support for Huawei E3372. This issue is now resolved.")
B.BR=new A.X("Android platform","Boot time improvements","Version 2022.44.1 includes multiple internal optimisations that allow for your Tesla Android to boot up faster after the car wakes from sleep.")
B.Cc=new A.X("Virtual display","Performance and quality improvements","Virtual display resolution has been increased to enable high fidelity Android experience in your Tesla.\n\nThe responsiveness is also improved thanks to internal changes in the video layer.")
B.CV=new A.X("CarPlay","Performance improvements","Improvements in the video layer leave more performance for other components.\n\nDecoding video stream from CarPlay is faster in version 2022.44.1.")
